import Dot from "../components/Dot";
import styles from "../styles/Home.module.css";

export default function Home() {
  return (
    <>
      <section>
        <div className={styles.map}>
          <Dot />
          <h3>Map</h3>
        </div>
      </section>
    </>
  );
}
